function odesphere(c,tf,ts,ho);
c=0.55; d=3; A=pi*(0.015)^2;g=9.81; ho=1.5; ts=6; tf=8000; ti=0;
 h(1)=ho;
t=[ti:ts:tf];
 n=length(t);
 for i=1:n 
 dhdt= -c*A*(sqrt(2*g*h(i)))/((pi*d*h(i))-pi*h(i)^2));
depth(i)=h(i);
 time(i)=t(i);
 h(i+1) =h(i)+dhdt*ts; 

 if h(i+1)<0 
     tbeforezero = t(i);
    tafterzero = t(i+1);
     break;
 end
 end
 fprintf('\nThe tank empties at between t = %i and %i seconds,\n\n',tbeforezero,tafterzero)
 plot(time,depth)
 grid on
 title( 'Depth,m vs time,S')
 xlabel('time,s')
 ylabel('depth,h')
 end

